using ImagesWebApi.Models;

namespace ImagesWebApi.Migrations
{
    using System;
    using System.Data.Entity;
    using System.Data.Entity.Migrations;
    using System.Linq;

    internal sealed class Configuration : DbMigrationsConfiguration<ImageContext>
    {
        public Configuration()
        {
            AutomaticMigrationsEnabled = true;
        }

        protected override void Seed(ImageContext context)
        {
            context.Images.Add(new SavedImage()
            {
                Id = Guid.NewGuid(),
                Text = "This is a test",
                ImageConverted =
                    @""
            });
        }
    }
}
